import styled from "styled-components";

const Father = styled.div`
  display: fles;
`;

const Btn = styled.div`
  color:white;
  background-color: tomato;
  border: 0;
  border-radius: 15px;
`

function App() {
  return (
    <Father>
      <Box bgColor="blue"/>
      <Box bgColor="teal"/>
      <Circle bgColor="tomato" />
    </Father>
  );
}

export default App;
